import "./home.scss";
import React from 'react';
import Login from "../login/Login";
import {BrowserRouter, Route, Routes} from "react-router-dom";

const Home = () => {
  return (
    <div>
      <div className="home-wrapper">
        <BrowserRouter>
        <div className="home-title">
          dboard
        </div>
        <Routes>
          <Route path="/login"><button>로그인</button></Route>
          <Route path="/signup"><button>회원가입</button></Route>
        </Routes>
        </BrowserRouter>
      </div>
    </div>
  )
}

export default Home;
